  [],\n\t\"revision_timestamp\": \"2016-07-27T23:01:37.146034\",\n\t\"name\": \"final-environmental-statement-for-the-proposed-missisquoi-wilderness-area-1975\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Missisquoi Wilderness Study concluded
  that nearly the entire wildlife refuge is, or will be, needed for intensive waterfowl
  habitat management. The Fish and Wildlife Service, however, proposed wilderness
  designation for the 114-acre Shad Island in the northern end of the refuge. This
  proposal for wilderness designation of the 620-acre area within the Missisquoi National
  Wildlife Refuge involved consideration of the following factors: 1) the preservation
  of 620 contiguous acres including the 114-acre Shad Island in a natural state. 2)
  The effect on existing and future public uses of the area. 3) The impact of the
  proposal on existing and future economic, cultural, and social values. 4) The effect
  on refuge programs and the attainment of refuge objectives.\",\n\t\"license_title\":
